import React from "react";
import "./App.css";

const myList = ["apple", "orange", "banana"];

const h1 = document.createElement("h1");
h1.innerHTML = "Car";
const root = document.getElementById("root")
root.appendChild(h1);
root.style.textAlign = 'center'

document.write(h1)
function App() {
  return (
    <div className="App">
      <p>Hello</p>
      <div id="root"></div>
      {myList.map((item , index) => (
        <p key={index}>{item}</p>
      ))}
    </div>
  );
}

export default App;
